import React from 'react';

const TodoList = ({items}) => {
	return (
		<div className="mt-5">
			<ul className="list-group">

				<li className="list-group-item">Download some library</li>
                {items.map(item => (
				<li className="list-group-item">{item}</li>
                ))}
			</ul>
		</div>
	);
};

export default TodoList;
